import "../styles/Home.css";

function Home() {
  return (
    <div className='home'>
    <div className='headerContainer' style ={ { backgroundImage: "url('backgroundImage')" } }>
      <h1>Nona's Pizza</h1>
      <p>Napoletana Pizza fit any taste</p>
      <Link to="/menu">
       <button> ORDER NOW</button>
       </Link>
    </div>
    </div>
  )
}

export default Home
